import React from 'react';
import classes from './toolbar.module.css'

const toolbar=()=>{
    return(
        <div className={classes.Toolbar}>
            <div className={classes.Menu}>
                menu
            </div>
            <div className={classes.Logo}>
                logo
            </div>
        </div>
    )
}

export default toolbar;
